create table attributes (id int4 generated by default as identity, created_at TIMESTAMP WITHOUT TIME ZONE, deleted boolean, deleted_at TIMESTAMP WITHOUT TIME ZONE, icon varchar(255), name varchar(255), updated_at TIMESTAMP WITHOUT TIME ZONE, primary key (id));
create table category (id int4 generated by default as identity, created_at TIMESTAMP WITHOUT TIME ZONE, deleted boolean, deleted_at TIMESTAMP WITHOUT TIME ZONE, description varchar(255), imagem_url varchar(255), name varchar(255), updated_at TIMESTAMP WITHOUT TIME ZONE, primary key (id));
create table images (id int4 generated by default as identity, created_at TIMESTAMP WITHOUT TIME ZONE, deleted boolean, deleted_at TIMESTAMP WITHOUT TIME ZONE, title varchar(255), updated_at TIMESTAMP WITHOUT TIME ZONE, url varchar(255), land_id int4, primary key (id));
create table land (id int4 generated by default as identity, created_at TIMESTAMP WITHOUT TIME ZONE, deleted boolean, deleted_at TIMESTAMP WITHOUT TIME ZONE, description varchar(255), localizationx varchar(255), localizationy varchar(255), name varchar(255), price float8, updated_at TIMESTAMP WITHOUT TIME ZONE, category_id int4, metaverse_id int4, primary key (id));
