create table role (id int4 generated by default as identity, created_at TIMESTAMP WITHOUT TIME ZONE, deleted boolean, deleted_at TIMESTAMP WITHOUT TIME ZONE, name varchar(255), updated_at TIMESTAMP WITHOUT TIME ZONE, primary key (id));
create table tb_land_attributes (land_id int4 not null, attributes_id int4 not null, primary key (land_id, attributes_id));
create table tb_user (id int4 generated by default as identity, created_at TIMESTAMP WITHOUT TIME ZONE, deleted boolean, deleted_at TIMESTAMP WITHOUT TIME ZONE, email varchar(255), last_name varchar(255), name varchar(255), password varchar(255), updated_at TIMESTAMP WITHOUT TIME ZONE, primary key (id));
create table tb_user_role (user_id int4 not null, role_id int4 not null, primary key (user_id, role_id));
